import React, { useState } from "react";
import { Grid, Paper } from "@material-ui/core";
import { useStyles } from "./styles/TrackerPageStyles";
import { Pie } from "react-chartjs-2";
import Calendar from "react-calendar";

const data = {
	labels: ["Protein", "Carbohydraetes", "Fat"],
	datasets: [
		{
			label: "Amount",
			data: [20, 40, 40],
			backgroundColor: ["red", "green", "blue"],
		},
	],
};

const TrackerPage = () => {
	const classes = useStyles();
	const [value, handleChange] = useState(new Date());
	const [chartData, setChartData] = useState(data);

	console.log(value);

	return (
		<div style={{ width: "100%" }}>
			<Grid container cols={2} className={classes.root}>
				<Grid item cols={1} md={3}>
					<Calendar
						onChange={handleChange}
						valu={value}
						minDetail="year"
						className={classes.calendar}
					/>
					<div>
						<Pie data={chartData} width={200} height={200} />
					</div>
				</Grid>
				<Grid item cols={1} md={8}></Grid>
			</Grid>
		</div>
	);
};

export default TrackerPage;
